if (environment.production) {
    enableProdMode();
}
const bootstrap = () => __NgCli_bootstrap_1.platformBrowser().bootstrapModule(AppModule);
if (environment.hmr) {
    if (module['hot']) {
        hmrBootstrap(module, bootstrap);
